import React from "react";
import { View } from "react-native";
import { styles } from "./styles";
import { strings } from "../../../translations/i18n";
import { SettingsButton, SettingsSwitch } from "../../../widgets/ModuleSettings";
import { IProps } from "./connect";
import Svg, { Image } from "react-native-svg";
import { Secure } from "../../../widgets/ModuleSettings/SettingsContent/assets";
import { ROUTES } from "../../../const";
export let ScreenSecurityView = ({ setFingerPrint, useFingerPrint, navigation }: IProps) => {
	return (
		<View style={styles.container}>
			<SettingsSwitch
				icon={<FingerPrint />}
				name={strings("useFingerPrint")}
				showBorderBottom
				onChange={() => setFingerPrint(!useFingerPrint)}
				value={useFingerPrint}
			/>
			<SettingsButton
				onPress={() => navigation.navigate(ROUTES.SCREEN_PIN_CODE)}
				icon={<Secure />}
				name={strings("changePin")}
				showBorderBottom
			/>
		</View>
	);
};

function FingerPrint(props) {
	return (
		<Svg
			xmlns="http://www.w3.org/2000/svg"
			xmlnsXlink="http://www.w3.org/1999/xlink"
			width={21}
			height={21.894}
			viewBox="0 0 21 21.894"
			{...props}
		>
			<Image
				width={21}
				height={21.894}
				xlinkHref="data:image/png;base64,"
			/>
		</Svg>
	);
}

export default FingerPrint;
